import React from 'react'
import fail from '../assets/img/ko.png'
export const ResponseKO = () => {
    return (
        <>
          <img src={fail} alt="fail" className="screen3__ico" />
          <h2>Ha habido un error</h2>
          <h3>No hemos podido modificar tu Password Manager. Inténtalo más tarde.</h3>
          <span className="screen3__button" type="submit">Volver a Password Manager <i className="bi bi-chevron-right"></i></span>
        </>
    )
}
